import React, {Fragment} from 'react'; 
import './App.css';
import Navbar from './component/layout/Navbar.js';
import Landing from './component/layout/landing.js';  
import { Router } from 'react-router';

function App() {
  return (
    <Router>
    <Fragment>
      <Navbar />
      <Landing/>
    </Fragment>
    </Router>
  );
}

export default App;
